import React from 'react'
import {aa} from '../video/aa.mp4';

const Home = () =>{
    return(
        <div className="home">
            qwe
            <video autoPlay muted loop>
                <source src={require('../video/aa.mp4')} type="video/mp4" />
                Your browser does not support the video tag. I suggest you upgrade your browser.
            </video>
        </div>
    )
}

export default Home;
